  false,\n\t\"url\": null,\n\t\"notes\": \"In response to a need for Columbia Basin
  wide evaluation of anadromous production potential during the Northwest Power Planning
  Council's Subbasin Planning Process, two work groups, the System Planning Group
  (SPG) and the Monitoring and Evaluation Group (MEG) developed the Smolt Density
  Model (SDM). The primary output of this model was an estimate of smolt carrying
  capacity by subbasin and stock which was used in the Council's System Planning Model
  (SPM). The SPM was a life cycle model used to predict effects on salmon and steelhead
  due to various strategies proposed by the planners. This model also provided an
  updated distribution dataset, along with a subjective habitat rating by species/run.
  This dataset contains output from the SDM (described above) and associated stream,
  taxonomic, life history, and physical habitat information. This data category is
  available through StreamNet's online query system, which allows users to explore
  and filter the StreamNet database and download selected results. For help in using
  the StreamNet query system, please consult the user guide, available at http://www.streamnet.org/onlinehelp/user_guide_03.html\",\n\t\"license_title\":
